// Common bend angles for dropdown selection
export const SABS62_COMMON_ANGLES: Record<SABS62BendType, number[]> = {
  '1D': [11.25, 15, 22.5, 30, 45, 60, 90],
  '1.5D': [11.25, 15, 22.5, 30, 45, 60, 90],
  '2D': [11.25, 15, 22.5, 30, 45, 60, 75, 90],
  '3D': [11.25, 15, 22.5, 30, 45, 60, 75, 90],
  '5D': [11.25, 15, 22.5, 30, 45, 60, 75, 85],
};

/**
 * Get C/F (Centre to Face) dimension for a SABS 62 pulled bend
 *
 * @param bendType - Bend type ('1D', '1.5D', '2D', '3D', or '5D')
 * @param angle - Bend angle in degrees
 * @param nb - Nominal bore in mm
 * @returns C/F dimension in mm, or undefined if not available
 */
export function sabs62CF(
  bendType: SABS62BendType,
  angle: number,
  nb: number
): number | undefined {
  const angleData = SABS62_CF_DATA[bendType]?.[angle];
  if (!angleData) return undefined;
  return angleData[nb];
}

/**
 * Get interpolated C/F for angles not in the table
 * Linear interpolation between nearest available angles
 */
export function sabs62CFInterpolated(
  bendType: SABS62BendType,
  angle: number,
  nb: number
): number | undefined {
  const bendData = SABS62_CF_DATA[bendType];
  if (!bendData) return undefined;

  // Check if exact angle exists
  const exactCF = sabs62CF(bendType, angle, nb);
  if (exactCF !== undefined) return exactCF;

  // Get all available angles for this bend type
  const angles = Object.keys(bendData).map(Number).sort((a, b) => a - b);

  // Find surrounding angles for interpolation
  let lowerAngle: number | undefined;
  let upperAngle: number | undefined;

  for (let i = 0; i < angles.length; i++) {
    if (angles[i] <= angle) lowerAngle = angles[i];
    if (angles[i] >= angle && upperAngle === undefined) upperAngle = angles[i];
  }

  if (lowerAngle === undefined || upperAngle === undefined) {
    return undefined;
  }

  if (lowerAngle === upperAngle) {
    return sabs62CF(bendType, lowerAngle, nb);
  }

  const lowerCF = sabs62CF(bendType, lowerAngle, nb);
  const upperCF = sabs62CF(bendType, upperAngle, nb);

  if (lowerCF === undefined || upperCF === undefined) {
    return undefined;
  }

  // Linear interpolation
  const ratio = (angle - lowerAngle) / (upperAngle - lowerAngle);
  return Math.round((lowerCF + ratio * (upperCF - lowerCF)) * 10) / 10;
}

/**
 * Get bend radius for SABS 62 bend
 */
export function sabs62BendRadius(
  bendType: SABS62BendType,
  nb: number
): number | undefined {
  return SABS62_BEND_RADIUS[bendType]?.[nb];
}

/**
 * Calculate bend radius if not in table (using multiplier)
 * R = NB x multiplier
 */
export function calculateSabs62BendRadius(
  bendType: SABS62BendType,
  nb: number
): number {
  const multiplierMap: Record<SABS62BendType, number> = {
    '1D': 1,
    '1.5D': 1.5,
    '2D': 2,
    '3D': 3,
    '5D': 5,
  };
  return nb * multiplierMap[bendType];
}

/**
 * Get available angles for a specific bend type and NB
 */
export function sabs62AvailableAngles(
  bendType: SABS62BendType,
  nb: number
): number[] {
  const bendData = SABS62_CF_DATA[bendType];
  if (!bendData) return [];

  return Object.entries(bendData)
    .filter(([_, nbData]) => (nbData as Record<number, number>)[nb] !== undefined)
    .map(([angle]) => Number(angle))
    .sort((a, b) => a - b);
}

/**
 * Check if a specific combination is available in the table
 */
export function isSabs62CombinationAvailable(
  bendType: SABS62BendType,
  angle: number,
  nb: number
): boolean {
  return sabs62CF(bendType, angle, nb) !== undefined;
}

/**
 * Get multiplier value for bend type
 */
export function sabs62Multiplier(bendType: SABS62BendType): number {
  const multiplierMap: Record<SABS62BendType, number> = {
    '1D': 1,
    '1.5D': 1.5,
    '2D': 2,
    '3D': 3,
    '5D': 5,
  };
  return multiplierMap[bendType];
}

/**
 * Get all bend types
 */
export function sabs62BendTypes(): SABS62BendType[] {
  return ['1D', '1.5D', '2D', '3D', '5D'];
}

/**
 * Get pipe data (OD, wall thickness, mass) for SABS 62
 */
export function getSabs62PipeData(
  grade: 'medium' | 'heavy',
  nb: number
): { od: number; massKgM: number; wallMm: number } | undefined {
  return (SABS62_PIPE_DATA[grade] as Record<number, { od: number; massKgM: number; wallMm: number }>)[nb];
}
